    <Layout title={"search results"}>
        <div className='container'>
            <div className="text-center">
                <h1>Search results</h1>
                <h6>{values?.results.length < 1 ? "No Results Found" : `Found ${values?.results.length}`}

                </h6>
            </div>
        </div>
    </Layout>
  )
}

export default Search
